import React from 'react'


    const Header = () => {
        const location = useLocation();

        if (location.pathname === '/login') {
            return (
                <header className="bg-gray-800">
                    <div className="container mx-auto px-4 py-6">
                        <div className="text-white text-4xl font-bold">FMB</div>
                    </div>
                </header>
            );
        }

        return (
            <header className="bg-gray-800">
                <div className="container mx-auto px-4 py-6">
                    <div className="flex items-center justify-between">
                        <div className="text-white text-4xl font-bold">FMB</div>
                        <nav className="space-x-4 uppercase">
                            <a href="#Dashboard" className="text-white hover:text-gray-300 no-underline">Dashboard</a>
                            <a href="#Logout" className="text-white hover:text-gray-300 no-underline">Logout</a>
                        </nav>
                    </div>
                </div>
            </header>
        );
    };


export default Header;
